import { all } from 'redux-saga/effects';
import {watchStartGetRequestServer} from './ViewType/sagasServerViewType';
import {watchStart_POST_RequestServer} from './ViewType/sagasNewDataViewType';


export default function* rootSaga(){
    yield all( [ 
                    watchStartGetRequestServer(),
                    watchStart_POST_RequestServer()

               ])
}
